    $(document).ready(function () {
        $('#btnsubmit').click(function (e) {
            if ($('#txtemail').val() == '') {
                e.preventDefault();
                Q.notify(-1, 'Email Required');
                return false;
            }
            if ($('#txtpassord').val() == '') {
                e.preventDefault();
                Q.notify(-1, 'Password Required');
